console.log(receiver.name); // 'file.js'



Object.getPrototypeOf() 和 Object.setPrototypeOf()
Object.getPrototypeOf() 返回任意知道对象的原型
Object.setPrototypeOf() 改变任意指定对象的原型
let person = {
        getGreeting() {
            return 'Hello';
        }
    };

    let dog = {
        getGreeting() {
            return 'woof';
        }
    }

    // 以person 对象为原型
    let friend = Object.create(person);
    console.log(friend.getGreeting());
    console.log(Object.getPrototypeOf(friend) === person);

    // 将原型设置为 dog
    Object.setPrototypeOf(friend, dog);
    console.log(friend.getGreeting());
    console.log(Object.getPrototypeOf(friend) === dog);



super

let person = {
        getGreeting() {
            return 'Hello'
        }
    };

    let friend = {
        getGreeting() {
            return super.getGreeting() + ' hi';
        }
    }

    // 将原型设置为person
    Object.setPrototypeOf(friend, person);
    console.log(friend.getGreeting()); // Hello hi

如果想重写对象的实例方法，有需要调用与它同名的原型方法，可以这样实现(ES5的写法)：
let person = {
        getGreeting() {
            return 'Hello'
        }
    };

    let dog = {
        getGreeting() {
            return 'Woof'
        }
    }

    let friend = {
        getGreeting() {
            return Object.getPrototypeOf(this).getGreeting.call(this) + ' hi';
        }
    }

    // 将原型设置为person
    Object.setPrototypeOf(friend, person);
    console.log(friend.getGreeting());    // Hello hi
    console.log(Object.getPrototypeOf(friend) === person);  // true

    // 将原型设置为dog
    Object.setPrototypeOf(friend, dog);
    console.log(friend.getGreeting()); // Woof hi
    console.log(Object.getPrototypeOf(friend) === dog); // true

上面的在多重继承的情况下会出错
let person = {
        getGreeting() {
            return 'Hello'
        }
    };


    let friend = {
        getGreeting() {
            return Object.getPrototypeOf(this).getGreeting.call(this) + ' hi';
        }
    }

    // 将原型设置为person
    Object.setPrototypeOf(friend, person);

    // 原型是friend
    let relative = Object.create(friend);

    console.log(person.getGreeting()); // Hello
    console.log(friend.getGreeting()); // Hello hi

    // this是relative，relative的原型是friend对象，当执行relative.getGreeting方法时，会调用friend的getGreeting()方法，而此时的this值为relative，Object.getPrototypeOf(this)又会返回friend对象，所以就会进入递归调用直到触发栈溢出报错
    console.log(relative.getGreeting()); // error !

使用super可以解决上面的问题
let person = {
        getGreeting() {
            return 'Hello'
        }
    };


    let friend = {
        getGreeting() {
            return super.getGreeting() + ' hi';
        }
    }

    // 将原型设置为person
    Object.setPrototypeOf(friend, person);

    // 原型是friend
    let relative = Object.create(friend);

    console.log(person.getGreeting()); // Hello
    console.log(friend.getGreeting()); // Hello hi
    console.log(relative.getGreeting()); // Hello hi

